pragma solidity ^0.4.23;

import "./Asset.sol";

contract GameWallet {

    address owner;

    Asset[] assets;
    mapping(address=>uint) assetIndexes;

    constructor(address _owner) public {
        owner = _owner;
    }

    function addAsset(Asset a) public {
        require(msg.sender == owner, "Only owner!");

        a.transfer(this);
        assets.push(a);
        //Actual index is index - 1, but as mapping default is 0 we can't use that index
        assetIndexes[a] = assets.length;
    }

    function freeAsset(Asset a) public {
        require(msg.sender == owner, "Only owner!");
        require(assetIndexes[a] > 0, "Asset not found");
        a.allowTransfer(owner);
        delete assets[assetIndexes[a] - 1];
        assets[assetIndexes[a] - 1] = assets[assets.length - 1];
        assets.length--;
    }

    function getAssets() public view returns (Asset[]) {
        return assets;
    }
}
